import React from 'react';
import './App.css';
import { Route, Redirect } from 'react-router-dom';
import Home from './components/Home';
import { About } from './components/About';
import { Services } from './components/Services';
import { Contact } from './components/Contact';
import Error from './components/Error';
import { User } from './components/User';

function App() {
  return (
    <>
      <Home />
      <Route
        path="/"
        activeClassName="active_class"
        exact component={() =>
          <Home name="Home" />
        }>
        Home
        </Route>
      <Route path="/about" activeClassName="active_class" exact
        render={() =>
          <About name="about " />
        }
      > About </Route>
      <Route path="/services" activeClassName="active_class" exact component={Services} > Services </Route>
      <Route path="/contact" activeClassName="active_class" exact component={Contact} > Contact </Route>
      <Route path="/user:fname:lname" activeClassName="active_class" exact component={User} > User </Route>
      <Redirect to="/error" component={Error}></Redirect>
    </>
  );
}

export default App;
